import React from 'react';
import Side from './sidebar';
function HelpMe(){
    return(
        <div fluid className="dashboard">
        <div>
        <Side/>
        </div>
        <div className="content">
            <div className="Fav"><h1>Help me</h1></div>
        </div>
        </div>
    )
}
export default HelpMe;
